import React from 'react';
import './app.css';

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      data: [],
    };
  };

  componentDidMount() {
    this.fetchData(`https://api.spacexdata.com/v3/rockets`);
  }

  fetchData = (apiToFetch) => {
    fetch(apiToFetch)
    .then(response => response.json())
    .then((data) => {
      console.log('Success:', data);
      this.setState({
        data: data,
      });
    })
    .catch((error) => {
      console.log("Error:", error)
    });
  };


  render() {

    return (
      <div className="App">
        <header className="App-header">
          <h1>
            SpaceX
          </h1>
        </header>

       <section>
          {this.state.data.map(
            (rocketOrDragon) => {
              return(
                <section key={rocketOrDragon.id}>
                  <p> Name </p> 
                  <p> {rocketOrDragon.name}  </p>
                  <p> Description </p>
                  <p> {rocketOrDragon.description} </p>
                  <p> Active? </p>
                  <p> {rocketOrDragon.active} </p>
                </section>
              )
            })
          }
        </section>

      </div>
    );
  }

}

export default App;
